import React from 'react'
import { AppBar, Toolbar, Typography, makeStyles, Button, Box, Card, CardContent} from '@material-ui/core'; 



const useStyle = makeStyles((theme) => ({
	title: {
		color: '#FF0000',
		fontSize: '500%',
		fontWeight: '600',
		marginTop: '5%',
		marginLeft: '15%',
	}

}));






function Signup() {
	const classes = useStyle();
	return (
		<div>
			<Typography className={classes.title}>
				Create Account
			</Typography>
			<div className={classes.icons}>
				<div className={classes.google}>
					<svg width="34" height="34" viewBox="0 0 34 34" fill="none" xmlns="http://www.w3.org/2000/svg">
					<path d="M33.3425 13.7358H32V13.6666H17V20.3333H26.4191C25.045 24.2141 21.3525 27 17 27C11.4775 27 6.99998 22.5225 6.99998 17C6.99998 11.4775 11.4775 6.99998 17 6.99998C19.5491 6.99998 21.8683 7.96165 23.6341 9.53248L28.3483 4.81831C25.3716 2.04415 21.39 0.333313 17 0.333313C7.79581 0.333313 0.333313 7.79581 0.333313 17C0.333313 26.2041 7.79581 33.6666 17 33.6666C26.2041 33.6666 33.6666 26.2041 33.6666 17C33.6666 15.8825 33.5516 14.7916 33.3425 13.7358Z" fill="#FFC107"/>
					</svg>
				</div>
			</div>
		</div>
	)
}

export default Signup;
